export default class Main extends React.Component
{
    constructor(props) {
        super(props)
    }

    state = {
        nome: 'Luciano'
    }

    setNome = () => {
        this.setState({
            nome: 10
        })
    }

    render(){
        return(
            <div>
                <button onCLick = {this.setNome()}>Teste</button>
                <p>{this.state.nome}</p>
            </div>
        )
    }
}
